INSERT INTO `produtos` VALUES (1,'Computador Desktop PCNOVO Gaming GML-MR58HD5','Computador da incrível gama gaming de Desktops PCNOVO. Construído com o utilizador avançado em mente, que procura a melhor proposta pelo valor!\r\n\r\nEsta configuração apresenta um processador de 6 núcleos AMD Ryzen 5 8400F da arquitetura Zen 4, para níveis incríveis de desempenho, tanto para gaming como para trabalho e lazer. Conta também com uma placa gráfica dedicada NVIDIA GeForce RTX 4060 da arquitetura NVIDIA Ada Lovelace, 16GB de memória DDR5 e armazenamento rápido SSD. Lentidão será coisa do passado!\r\n\r\nA certeza de que a qualidade não será sacrificada na busca pela grandeza!\r\n\r\nConhece já as especificações em detalhe desta configuração assemblada pelo PCNOVO.','COMPONENTES\r\n\r\nSISTEMA OPERATIVO\r\n	Sistema Operativo não incluído. Instalação gratuita se adquirido aqui juntamente com o computador e se solicitada instalação nas observações da encomenda.\r\nPROCESSADOR\r\n	AMD Ryzen 5 8400F \"Zen 4\" 6-Core 4.2GHz c/ Turbo 4.7GHz 22MB Cache SktAM5\r\nCOOLING CPU\r\n	Cooler OEM AMD\r\nCAIXA\r\n	Micro-ATX MSI MAG Forge M100R ARGB Tempered Glass Preta\r\nMOTHERBOARD\r\n	Micro-ATX MSI Pro B650M-B\r\nPLACA GRÁFICA\r\n	MSI NVIDIA GeForce RTX 4060 \"Ada Lovelace\" Ventus 2X Black 8G OC GDDR6 DLSS3\r\nMEMÓRIA RAM\r\n	Kingston Fury Beast RGB 16GB (1x16GB) DDR5-6000MHz (AMD Expo/Intel XMP) CL30 (30-36-36) 1.40V 1Rx8 Preta\r\nARMAZENAMENTO\r\n	SSD M.2 2280 MSI Spatium M470 Pro 1TB 3D NAND NVMe PCIe 4.0 Gen 4.0x4\r\nALIMENTAÇÃO\r\n	ATX MSI MAG A650BN 650W 80 Plus Bronze\r\nDIMENSÕES DO COMPUTADOR\r\n	388mm (Profundidade) x 200mm (Largura) x 423mm (Altura)\r\n	\r\nAtenção: Esta configuração não inclui a possibilidade de alterações dos componentes incluídos a pedido do utilizador.',899.00,_binary '\\\0JFIF\0\0\0\0\0\0\\0C\0\n\n\n\n\r\r#%$\"\"!&+7/&)4)!\"0A149;>>>%.DIC<H7=>;\\0C\n\r;(\"(;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;\0\\\"\