eu jogo.\r\n\r\nVELOCIDADE PCIE 4.0 MAXIMIZADA\r\nEnorme aumento de velocidade. Velocidades de leitura/gravação 40% e 55% mais rápidas do que 980 PRO - até 1.400K/1.550K IOPS, enquanto as velocidades sequenciais de leitura/gravação até 7.450/6.900 MB/s atingem quase o desempenho máximo do PCIe® 4.0. Voar alto em jogos, edição de vídeo e 3D, análise de dados, e muito mais.\r\n\r\nEFICIÊNCIA ENERGÉTICA REVOLUCIONÁRIA\r\nDesempenho mais eficiente em termos de potência. Um desempenho mais elevado consome normalmente mais energia. 990 PRO utiliza menos potência com um desempenho até 50% melhor por Watt acima de 980 PRO. Este desenho de baixa potência torna possível um desempenho máximo PCIe® 4.0 com uma eficiência energética ótima.\r\n\r\nSOLUÇÃO TÉRMICA INTELIGENTE\r\nVelocidade para além do calor. O controlador revestido a níquel e o algoritmo de controlo térmico de vanguarda gerem o calor para um desempenho inabalável. A etiqueta do espalhador de calor controla o calor do chip NAND, enquanto a Guarda Térmica Dinâmica mantém as temperaturas ótimas.\r\n\r\nSOFTWARE SAMSUNG MAGICIAN\r\nDesbloquear a potência total de 990 PRO. O conjunto de ferramentas de otimização de fácil utilização do software Samsung Magician consegue sempre o melhor desempenho SSD. Proteja dados, receba atualizações, e monitorize o estado da unidade. O seu conjunto de ferramentas SSD pessoal.','Especificações:\r\nCapacidade: 2 TB\r\nFormato: M.2 2280\r\nInterface: PCIe 4.0 x4, NVMe 2.0\r\nCache: Samsung 2GB Low Power DDR4 SDRAM\r\nControladora: Samsung in-house Controller\r\nNAND: Samsung V-NAND 3-bit MLC\r\nVelocidade Sequencial Leitura: Até 7,450 MB/s\r\nVelocidade Sequencial Escrita: Até 6,900 MB/s\r\nLeitura Aleatória 4kb (QD32): Até 1.400.000 IOPS\r\nEscrita Aleatória 4kb (QD32): Até 1.550.000 IOPS\r\nTBW: 1200 TBW\r\nPeso: 9 grs',184.90,_binary '\\\0JFIF\0\0\0\0\0\0\0<CREATOR: gd-jpeg v1.0 (using IJG JPEG v80), quality = 100\n\\0C\0\n\n\n\n\r\r#%$\"\"!&+7/&)4)!\"0A14